import React from 'react';
import './student.css';

function Student(props) {
  const { name, birthdate, zodiacSign, favoriteMovieOrTVShow, hobbies, futureGoal, futureIn20Years } = props.data;

  return (
    <div className="student">
        <div className="student-info">
            <img className="student-photo" src="https://via.placeholder.com/150" alt="student" />
            <div className="student-name">{name}</div>
        </div>
        <ul className="student-attributes">
            <li><div className='attribute'><strong>Birthdate:&nbsp; </strong> {birthdate}</div></li>
            <li><div className='attribute'><strong>Zodiac sign: </strong> {zodiacSign}</div></li>
            <li><div className='attribute'><strong>Favorite movie/TV show: </strong> {favoriteMovieOrTVShow}</div></li>
            <li><div className='attribute'><strong>Hobbies: </strong> {hobbies}</div></li>
            <li><div className='attribute'><strong>What I want to do in the future: </strong> {futureGoal}</div></li>
            <li><div className='attribute'><strong>Me in 20 years: </strong> {futureIn20Years}</div></li>
        </ul>
    </div>
  );
}

export default Student;
